struct MyStruct { number: usize,
} Nhưng một số trait phức tạp hơn bạn cần định nghĩa cụ thể bằng cách impl nó. Ví dụ bạn có trait Add ( std::ops::Add ) để add 2 type lại với nhau. Nhưng Rust sẽ không biết cách bạn add 2 type đó lại như thế nào, bạn cần phải tự định nghĩa: use std::ops::Add; struct MyStruct { number: usize,
} impl Add for MyStruct { // <-- here type Output = Self; fn add(self, other: Self) -> Self { Self { number: self.number + other.number } }
